---
$schema: "http://json-schema.org/draft-07/schema#"
additionalProperties: true
properties:
  AllowedLicenses:
    type:
      - integer
      - "null"
  CreatedDate:
    format: date-time
    type:
      - string
      - "null"
  ExpirationDate:
    format: date-time
    type:
      - string
      - "null"
  Id:
    type: string
  IsProvisioned:
    type:
      - boolean
      - "null"
  LastModifiedDate:
    format: date-time
    type:
      - string
      - "null"
  NamespacePrefix:
    type:
      - string
      - "null"
  Status:
    type:
      - string
      - "null"
  SystemModstamp:
    format: date-time
    type:
      - string
      - "null"
  UsedLicenses:
    type:
      - integer
      - "null"
reduce:
  strategy: merge
required:
  - Id
type: object
